import {BrowserRouter, Routes, Route} from 'react-router-dom';
import './App.css';

function App() {
  return (
 <BrowserRouter>
 <Header/>
<Routes>
  <Route path='/' element={<Home/>}/>
  <Route path='/home' element={<Home/>}/>
  <Route path='/about' element={<About/>}/>
  <Route path='/*' element={<PageNotFound/>}/>
 </Routes>
 </BrowserRouter>
  );
}

export default App;
